import React from 'react'
import { GitHub } from '@material-ui/icons';
import InstagramIcon from '@material-ui/icons/Instagram';
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';

function SocialAccounts() {
    return (
        <div className = "socialAccounts">
            <div className = "icons"><GitHub style={{ fill: "#45B09F", fontSize: "40px", paddingBottom: "20px" }}/></div>
            <div className = "icons"><LinkedInIcon style={{ fill: "#45B09F", fontSize: "40px", paddingBottom: "20px" }}/></div>

            <div className = "icons"><InstagramIcon style={{ fill: "#45B09F", fontSize: "40px", paddingBottom: "20px" }}/></div>

            <div className = "icons"><FacebookIcon style={{ fill: "#45B09F", fontSize: "40px", paddingBottom: "20px" }}/></div>

            <div className = "vertical"></div>
        </div>
    )
}

export default SocialAccounts;
